import React from 'react';
import './Scouting.css';

class Scouting extends React.Component {

    constructor (props){
        super(props);
    }

    render() {
        return(
            <div id="Scouting">
                <h1>SCOUTING</h1>
                <div id="border"></div>
            </div>
        );
    }
}

export default Scouting;
